„Nežymėta policijos „Audi“ kelyje Vilnius–Panevėžys užfiksavo automobilį, skriejusį net 205 km/val. greičiu. Vairuotojas sustabdytas, jam skirta 225 eurų bauda, o artimiausią mėnesį teks pasivaikščioti pėsčiomis“, – įrašą socialiniame tinkle „Facebook“ pirmadienį paskelbė  Lietuvos policija . Vairuotojui skirta pusė vidutinės baudos. O praėjusią savaitę, visoje Europoje vykstant Europos kelių policijos tinklo TISPOL inicijuotiems reidams, nežymėtas policijos automobilis kelyje Alytus–Seirijai–Lazdijai sulaikė kelių pažeidėją, skriejusį 195 km/val. greičiu. Sustabdžius paaiškėjo, kad vairuotojas teisę vairuoti gavo tik prieš du mėnesius, tad jam leistinas greitis – 70 km/val. Vairuotojui skirta 225 eurų bauda ir 12-ai mėnesių atimta teisė vairuoti. Tokios baudos sukėlė ne tik politikų, bet ir šalies gyventojų pyktį bei pašaipas – tai esą ne tik neatgraso nuo nusikalstamos veikos, bet netgi ją skatina. „Man tai keista, kad tokia maža piniginė nuobauda... Čia viršijama net ne 50 km/val., bet daugiau nei 100 km/val. Be to, šis vairuotojas net neturi dvejų metų stažo. Tokiu atveju turėtų gauti viešųjų darbų bent mėnesiui. Tokia gėda verstų susimąstyti kitą kartą. Visi mes ne angelai prie vairo, bet ne du mėnesius turint teises lėkti 195 km/val. greičiu“, – stebisi vairuotojas Vitoldas Rogoža. Tokiais baudų dydžiais negali patikėti ir kitas pilietis Gabrielius Martinkevičius: „Lietuvos policija, čia, jūsų manymu, adekvati ir normali bauda? Ar kas nors iš jūsų bent bando keisti baudas, rašyti atitinkamus raštus? Jūs gi esate profesionalai, jūsų klausosi. Čia turi būti teisių atėmimas penkeriems metams ir keli mėnesiai kalėjimo. Ar bent pajudinate pirštą dėl baudų adekvatumo? Aš suprantu – baudas nustatote ne jūs, bet jūs jas galite keisti, naudodami atitinkamus mechanizmus.“ (function(d, s, i, r) {
