avę ir stacionariais greičio matuokliais, ir nežymėtais policijos automobiliais. Mūsų siekis – kad būtų paisoma KET ir laikomasi saugaus leistino greičio. Jei vairuotojas žino, kad bet kada gali būti užfiksuotas nežymėtu policijos automobiliu, tai kažkiek turi veikti jo sąmonę“, – svarstė V. Grašys. Viršininkas priminė ir dar vieną naujovę šalies keliuose – tam tikruose ruožuose jau pastatyti kelio ženklai, kuriuose nurodyta, kad kelyje dirba nežymėtas policijos automobilis. „Atsirado kelio ženklai ir norisi, kad visuose keliuose jie atsirastų. Vairuotojai žinotų, kad policija budi ir pažeidėjai bus sulaikyti“, – LRT.lt dėstė V. Grašys. K. Masiulis: tai tiesiog protu nesuvokiama Savo ruožtu Seimo Tėvynės sąjungos-Lietuvos krikščionių demokratų frakcijos narys Kęstutis Masiulis stebisi tokiais mažais baudų dydžiais už didžiulius greičio viršijimus. „Be abejo, tokios baudos už tokį grėsmingą vairavimą yra juokingos. Suprantu, visko gyvenime būna, žmonės paskuba, bet neviršija greičio 70 km/val. Lėkti Lietuvoje didesniu nei 200 km/val. greičiu, ypač tokiame kelyje... Čia protu nesuvokiama. O baudos beveik skatina dar sykį taip elgtis“, – stebėjosi K. Masiulis. Anot parlamentaro, policija skelbia apie nulio tolerancijos akcijas, bet tai esą – laiko gaišimas, ir laiką reikėtų skirti kitiems dalykams. „Kartais juokinga, kai turi akis išplėtęs žiūrėti į spidometrą ir viršijęs greitį 1,5 km/val. susilauki pagrūmojimo. Tik gaišta laiką, nes negali net baudos skirti, tik įspėjimą. Tai juk kainuoja pinigus. Mano supratimu, kartais tokios akcijos neprotingos. Reikėtų kalbėti būtent apie tokius greičio viršijimo pažeidimus ir baudų proporcingumą. Aš būčiau linkęs didinti baudas, bet reikia peržiūrėti jas visas. Dabar prezidentė ir kiti asmenys kalbėjo apie tai, kad Lietuvoje per daug asmenų sėdi kalėjimuose ir esame neproporcingai griežti nusižengėliams. Galima kartais to kalėjimo ir atsisakyti, bet už tokį grėsmingą vairavimą reikėtų tvoti per kišenę ir galbūt konfiskuoti automobilį. Grėsmingai važiavai – nebevažinėk, kad tai tau būtų pamoka. Bet svarbu, kad būtų peržiūrėtos visos baudos ir nebūtų taip, kad vienas padidinome, o kitos tuomet tampa juokingomis“, – LRT.lt kalbėjo K. Masiulis. Valstiečių ir žaliųjų sąjungos frakcijos seniūno pavaduotojas Virginijus Sinkevičius taip pat mano, kad reikia peržiūrėti ANK. „Manau, kad jis yra tiesiog nesureguliuotas. Jei viršijo greitį 50 ar 70 km/val. – atima teises mėnesiui, o jei vairuotojas kirto ištisinę eismo juostą – atima 3 mėnesiams ir sulaukia tokios pačios baudos. Man tai parodo visišką ANK nesubalansavimą. Pripažinkime, kad ištisinės linijos kirtimas kelia mažiau grėsmės nei važiavimas 205 km/val. greičiu. Įstatymas tiesiog padrikas“, – įvertino V. Sinkevičius. Vis dėlto „valstietis“ nežino, ar baudų didinimas pažabotų kelių gaidelius: „Sunku pasakyti dėl to greičio. Aš nežinau, ar didelis griežtinimas padėtų, reikia žiūrėti į statistiką, kiek po tokios baudos skyrimo vairuotojas dar padarė pažeidimų. O gal pakako vieno karto, kad susimąstytų? Turime ir kitą problemą – etatinius kelių gaidelius, kurie kaip pažeidinėjo KET, taip pažeidinėja, nesvarbu, ar turi vairuotojo pažymėjimą, ar ne. Turime spręsti ir baudų išieškojimo problemą, nes nemažai žmonių apskritai nemoka baudų ir nemato bėdos. Nematau reikalo baudas labai griežti tam, kuris skubėjo, bet po nusižengimo suprato kaltę, ja nesididžiuoja ir sąžiningai sumokėjo baudą, daugiau nenusižengė.“ Tuo metu automobilio konfiskacijai V. Sinkevičius teigė pritariantis. „Žinoma, ji turėtų būti taikoma ne pirmą kartą prasižengusiems, o nuolatiniams pažeidėjams. Jei neklystu, esame viena iš nedaugelio Europos valstybių, kur net ir antrą kartą nesusimokęs baudos tolimųjų reisų vairuotojas yra paleidžiamas. Kitose valstybėse automobilis dažniausiai pastatomas į aikštelę ir saugomas tol, kol į valstybės sąskaitą neįkrenta pinigai už KET pažeidimą. Tai – dar viena prevencinė priemonė, kuri turėtų būti“, – įsitikinęs V. Sinkevičius. Saugaus eismo ekspertas: tokie pažeidėjai – be smegenų Praktinio vairavimo mokytojas ir vairavimo mokymo teorijos dėstytojas Artūras Pakėnas taip pat negali atsistebėti tokiais baudų dydžiais ir tokiais KET pažeidėjais, lakstančiais daugiau kaip 200 km/val. greičiu šalies gatvėmis ir keliais. „Tokios baudos atrodo keistai, bet ne aš kuriu įstatymus. Tai – valstybės sprendimai. Jei jiems atrodo, kad taip gerai, – tai gerai, bet, manau, bauda galėtų priklausyti nuo gaunamų pajamų ar turto, kaip yra ne vienoje valstybėje. Tai šiek tiek efektyviau. Kita vertus – ką tada imsim iš bedarbių“, – svarstė A. Pakėnas. Vis dėlto jis tikisi, kad valdžios atstovai pagaliau atkreips dėmesį į baudų dydžius. „Kodeksas – naujas, todėl gal pamatys neatitikimus ir pataisys. Gerai, kad ir spauda apie tai rašo“, – pridūrė A. Pakėnas. Tačiau labiausiai saugaus eismo žinovas stebisi kelių chuliganais, lakstančiais beprotišku greičiu. „Ką mąsto tokie pažeidėjai? Jie nemąsto. Jei mąstytų, taip nesielgtų. Tai – žmonės be smegenų. Tai – asocialūs asmenys. Aš juos vadinu asocialiais, nes eismas yra socialinis reiškinys ir žmogus, kuris nepaiso visuomenės numatytų taisyklių ir normų, yra asocialus. Taip ir vertinčiau – kaip asocialų. Jis nėra pilietis. Jis – niekas. Čia yra ir auklėjimo problemų. Pažįstama psichiatrė sakė, kad tai – ir asmenybės problemos. Tiesiog žmogus yra ligonis ir jį reikia gydyti“, – apie kelių gaidelius atsiliepė A. Pakėnas. ANK numato: Bauda (Eurais) Teisės vairuoti atėmimas (mėn.) Kita
